INSERT INTO ims_article_news VALUES 
('1','1','三星牧业“微商平台”进入测试阶段','<p>2016年元月7日上午，三星牧业市场运行部各部负责人齐聚公司总部，开展三星牧业“微商平台”测试工作。</p>','images/3/articles/cm56ljfd74jOvP0p8p8O6D5jFDFVPP.png','自创','张会朋','0','1','1','1452082704','0'),
('2','1','庆平台顺利开通，人工乳“好妈妈”限时抢购中','<p>&nbsp;&nbsp;为了庆祝“饲料微商”线上交易平台顺利开通，感谢广大客户对“三星牧业”的关注和支持，自2016年1月16日至1月22日，本平台持续开展线上限时抢购活动，具体规则如下：</p><p>&nbsp;&nbsp;一、活动内容：</p><p>&nbsp;&nbsp;1、活动期间原价50元/袋的仔猪人工乳“好妈妈”每天10：00-11：00抢购仅需10元/袋。</p><p>&nbsp;&nbsp;2、每个会员抢购时间段内最多抢购10袋。</p><p>&nbsp;&nbsp;二、抢购方法：</p><p>&nbsp;&nbsp;1、公众平台输入“抢购”，规定时间段内点击“查看全文”进入跳转页面直接选择“购买”按提示操作即可。</p><p>&nbsp;&nbsp;2、进入平台后，点击“饲料商城”选择“抢购产品”，规定时间段内进入跳转页面直接选择“购买”按提示操作即可。</p><p>&nbsp;&nbsp;三：声明</p><p>&nbsp;&nbsp;1、本品为促销产品，本品10袋以上或配合公司其他平台产品均包邮，运费公司承担，订购本产品10袋以下，运费需自行承担<strong>（省内运费约5元，省外运费约20元，以实际发生金额为准）。</strong></p><p>&nbsp;&nbsp;2、订购后公司采用物流方式投送，河南省内仅投送至县级以上物流点，省外仅投送至市级以上物流点。</p>','images/3/articles/EXXxUdU7uDyzX6xPZVx2xMYbdauvLd.jpg','自创','zhp','101','1','1','1452875355','15');
