('2','3','0','庆平台顺利开通，人工乳“好妈妈”限时抢购中','images/3/2016/01/BlE133Vh4E9318BHF1rZFL1eeELl84.jpg','','<p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;为了庆祝<span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">饲料微商</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">线上交易平台顺利开通，感谢广大客户对</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">三星牧业</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">的关注和支持，自</span><span style=\"font-family:Calibri\">2016</span><span style=\"font-family:宋体\">年</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">16</span><span style=\"font-family:宋体\">日至</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">22</span><span style=\"font-family:宋体\">日，本平台持续开展线上限时抢购活动，具体规则如下：</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;<span style=\"font-family:宋体\">一、活动内容：</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、活动期间原价</span><span style=\"font-family:Calibri\">50</span><span style=\"font-family:宋体\">元</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">袋的仔猪人工乳</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">好妈妈</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">每天</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">：</span><span style=\"font-family:Calibri\">00-11</span><span style=\"font-family:宋体\">：</span><span style=\"font-family:Calibri\">00</span><span style=\"font-family:宋体\">抢购仅需</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">元</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">袋。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、每个会员抢购时间段内最多抢购</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">袋。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;<span style=\"font-family:宋体\">二、抢购方法：</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、公众平台输入</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">抢购</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">，点击</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">查看全文</span><span style=\"font-family:Calibri\">”可详细查看本次活动内容</span><span style=\"font-family:宋体\">。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、进入平台后，点击</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">饲料商城</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">选择</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">抢购商品</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">，规定时间段内进入跳转页面直接选择</span><span style=\"font-family:Calibri\">“直接</span><span style=\"font-family:宋体\">购买</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">按提示操作即可。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;<span style=\"font-family:宋体\">三：声明</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、本品为促销产品，本品</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">袋以上或配合公司其他平台产品均包邮，运费公司承担，订购本产品</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">袋以下，运费需自行承担</span></span><span style=\";font-family:&#39;Times New Roman&#39;;font-weight:bold\">（省内运费约<span style=\"font-family:Times New Roman\">5</span><span style=\"font-family:宋体\">元，省外运费约</span><span style=\"font-family:Times New Roman\">20</span><span style=\"font-family:宋体\">元，以实际发生金额为准）。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、订购后公司采用物流方式投送，河南省内仅投送至县级以上物流点，省外仅投送至市级以上物流点。</span></span></p><p><br/></p>','1','1452885076'),
('3','3','1','平台升级通知','images/3/2016/01/tNaCyGNMz5QuYGBlaNgu4Xzl41Bugy.jpg','','<p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">各位亲们：</span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">首先感谢大家对“饲料微商”的关注和支持，为了能更好地为大家提供服务，经研究决定自<span style=\"font-family:Calibri\">2016</span><span style=\"font-family:宋体\">年元月</span><span style=\"font-family:Calibri\">23</span><span style=\"font-family:宋体\">日</span><span style=\"font-family:Calibri\">-</span><span style=\"font-family:宋体\">元月</span><span style=\"font-family:Calibri\">31</span><span style=\"font-family:宋体\">日开展平台持续升级工作，主要升级内容有：</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、菜单的变更和调整</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、店面装修和美化</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;3<span style=\"font-family:宋体\">、个别功能性模块调整。</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;4<span style=\"font-family:宋体\">、会员分组管理。</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">因系统升级给您带来的不便我们深表歉意，升级期间我们将会采用边运营边升级的的方法，并向大家承诺，升级不会影响您的：</span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、会员等级和佣金分成。</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、商品订购和发货。</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;3<span style=\"font-family:宋体\">、余额和微信支付的安全。</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">再次感谢大家的支持和配合，在使用过程中如您遇到不明白之处，请致电：<span style=\"font-family:Calibri\">4009939099</span><span style=\"font-family:宋体\">转业务咨询，或联系在线客服</span><span style=\"font-family:Calibri\">QQ</span><span style=\"font-family:宋体\">：</span><span style=\"font-family:Calibri\">390071985</span><span style=\"font-family:宋体\">，升级期间将会为您提供全天</span><span style=\"font-family:Calibri\">24</span><span style=\"font-family:宋体\">小时服务。</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">&nbsp;</span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;饲料微商电子商务管理中心</span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2016<span style=\"font-family:宋体\">年</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">23</span><span style=\"font-family:宋体\">日&nbsp;</span></span></p><p><br/></p>','1','1453544065');
