INSERT INTO ims_news_reply VALUES 
('3','27','0','三星牧业牧业欢迎您','墨阳','开创中国饲料微商第一品牌','images/3/2016/01/nUY6duNI87u866Xur4080uoI5y08Ny.jpg','<p style=\"text-indent:37px\"><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">河南三星牧业科技有限公司是由一批掌握国内外高新技术和管理经验的高级智慧型人才，按现代企业模式组建的股份制企业。她拥有多名动物营养、畜牧、兽医专业技术与管理兼用型专家。本科、大专学历以上的人才占公司员工总人数的<span style=\"font-family:ˎ̥,Verdana,Arial\">85%</span><span style=\"font-family:宋体\">以上。</span></span><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\"><br/></span><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">　　河南三星牧业科技有限公司</span><span style=\"font-family: 宋体;font-size: 19px\">平原新区生产基地，位于中国郑州花园口黄河桥北</span><span style=\"font-family: 宋体;font-size: 19px\">3<span style=\"font-family:宋体\">公里平原新区工业园三星路</span><span style=\"font-family:ˎ̥,Verdana,Arial\">1</span><span style=\"font-family:宋体\">号，交通便利、环境优美。公司平原新区生产基地</span></span><span style=\"font-family: 宋体;font-size: 19px\">先后</span><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">举资</span><span style=\"font-family: 宋体;font-size: 19px\">79</span><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">00<span style=\"font-family:宋体\">万元，引进</span></span><span style=\"font-family: 宋体;font-size: 19px\">国内先进的</span><span style=\"font-family: 宋体;font-size: 19px\">预混料成套生产设备，采用三级混合、全自动生产工艺，年预混料单班生产能力达</span><span style=\"font-family: 宋体;font-size: 19px\">24</span><span style=\"font-family: 宋体;font-size: 19px\">000</span><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">吨</span><span style=\"font-family: 宋体;font-size: 19px\">；引进全自动控制浓缩料、配合料生产设备，采用先进的生产工艺，年浓缩料、配合料单班生产能力达</span><span style=\"font-family: 宋体;font-size: 19px\">300000<span style=\"font-family:宋体\">吨；公司采用产品质量可追溯管理机制，拥有省内一流的化验室，原子吸收、紫外分光光度计、液相色谱、高精度分析天平等</span></span><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">各种检验设备齐全。</span><span style=\"font-family: 宋体;font-size: 19px\">生产的</span><a href=\"http://www.hasxmy.com/\"><span style=\";font-family:ˎ̥,Verdana,Arial;color:rgb(0,0,0);font-size:19px\">猪料</span></a><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">、</span><a href=\"http://www.hasxmy.com/\"><span style=\";font-family:ˎ̥,Verdana,Arial;color:rgb(0,0,0);font-size:19px\">牛料</span></a><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">、</span><a href=\"http://www.hasxmy.com/\"><span style=\";font-family:ˎ̥,Verdana,Arial;color:rgb(0,0,0);font-size:19px\">兔料</span></a><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">、</span><a href=\"http://www.hasxmy.com/\"><span style=\";font-family:ˎ̥,Verdana,Arial;color:rgb(0,0,0);font-size:19px\">鹅料</span></a><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">、</span><a href=\"http://www.hasxmy.com/\"><span style=\";font-family:ˎ̥,Verdana,Arial;color:rgb(0,0,0);font-size:19px\">禽料</span></a><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">以及水产料系列产品</span><span style=\"font-family: 宋体;font-size: 19px\">，具有</span><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">优质、高效、环保、安全</span><span style=\"font-family: 宋体;font-size: 19px\">等</span><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">显著特点。&nbsp;</span></p><p style=\"text-indent:37px\"><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">公司以<span style=\"font-family:ˎ̥,Verdana,Arial\">“</span><span style=\"font-family:宋体\">振兴民族饲工业，志创百年饲料品牌</span><span style=\"font-family:ˎ̥,Verdana,Arial\">”</span><span style=\"font-family:宋体\">为奋斗目标，恪守</span><span style=\"font-family:ˎ̥,Verdana,Arial\">“</span><span style=\"font-family:宋体\">以人为本，科技为先、诚信经营、追求卓越</span><span style=\"font-family:ˎ̥,Verdana,Arial\">”</span><span style=\"font-family:宋体\">，本着</span><span style=\"font-family:ˎ̥,Verdana,Arial\">“</span><span style=\"font-family:宋体\">务实、创新、勤俭、自强、协作、双赢</span><span style=\"font-family:ˎ̥,Verdana,Arial\">”</span><span style=\"font-family:宋体\">的创业精神，开拓进取，谋求大业。勤劳智慧、团结仁爱、务实创新的三星人凭着他们的坚毅果敢、诚信干练、博大睿智，一定会使三星牧业成为中国饲料工业一颗冉冉升起的新星，她必将为我国畜牧业的发</span></span><span style=\"font-family: 宋体;font-size: 19px\">展</span><span style=\"font-family: ˎ̥, Verdana, Arial;font-size: 19px\">添光增彩。</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">三星牧业分支机构</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">三星牧业网</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">三星牧业发展学院</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">三星牧业饲料研究所</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">三星牧业</span><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">·</span><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">百事利疫苗销售公司</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">三星牧业</span><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">·</span><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">汉拜汉商贸</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">企业荣誉：</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">河南省饲料工业协会理事单位</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">河南社会主义新农村建设促进会畜牧委员会会长单位</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">中国养兔协会副会长单位</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">中国鹅业协会常务理事单位</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">河南省养牛协会副会长单位</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">河南省经济战略学会鹅业工程委员会常务副会长单位</span></p><p><span style=\"font-family: 宋体;font-weight: bold;font-size: 19px\">郑州大学药学系中药科研基地</span></p><p><span style=\"font-family: Tahoma;color: rgb(51, 51, 51);letter-spacing: 0;font-weight: bold;font-size: 19px;background: rgb(255, 255, 255)\">河南牧业经济学院战略合作单位。</span></p><p><span style=\"font-family: ˎ̥, Verdana, Arial;font-weight: bold;font-size: 19px\">三星</span><a href=\"http://www.hasxmy.com/\"><span styl