('4','31','0','热烈祝贺三星牧业“微商平台”进入实测阶段','张会朋','2016年元月7日上午，三星牧业市场运行部各部负责人齐聚公司总部，开展三星牧业“微商平台”测试工作。','images/3/2016/01/ZYXdvaXJVP9pyrggvvNKjnxz9gKMrx.png','<p>2016年元月7日上午，三星牧业市场运行部各部负责人齐聚公司总部，开展三星牧业“微商平台”测试工作。</p>','','1','1','1452879801'),
