('8','38','0','展示日常看不到的养猪损耗：论猪场经营成本，如何精打细算?','','加强企业成本核算，并对核算的结果进行细致的分析是提高猪场经济效益最重要的途径之一。','images/3/2016/01/HnQnJ23Pazk7jBZ3c3eJJC3OIAdiQe.jpg','<h2 class=\"rich_media_title\" id=\"activity-name\" style=\"margin: 0px 0px 14px;padding: 0px 0px 10px;font-weight: 400;font-size: 24px;line-height: 1.4;border-bottom-width: 1px;border-bottom-style: solid;border-bottom-color: rgb(231, 231, 235);\">展示日常看不到的养猪损耗：论猪场经营成本，如何精打细算?</h2><p><img class=\"rich_media_thumb\" id=\"js_cover\" data-backsrc=\"http://mmbiz.qpic.cn/mmbiz/8e1hx3LZSiaZ9hqMhwKlicSNVHZ3jnmrXkzqwDGuYWmiasCX6p5sAC34ib0vGCgZzA1UtypT1QNOvIpA0xFr6jSUibg/0?wx_fmt=jpeg\" data-s=\"300,640\" src=\"http://mmbiz.qpic.cn/mmbiz/8e1hx3LZSiaZ9hqMhwKlicSNVHZ3jnmrXkzqwDGuYWmiasCX6p5sAC34ib0vGCgZzA1UtypT1QNOvIpA0xFr6jSUibg/640?wx_fmt=jpeg&tp=webp&wxfrom=5\" style=\"margin: 0px;padding: 0px;height: auto !important;display: block;width: 670px;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><br/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;line-height: 25.6px;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-family: 宋体;font-size: 12px;\">免责申明：本微信服务平台资料来源于网络收集，以供给大家学习、交流为目的，请诸位在阅读后，尽快删除，尊重资料原作者，支持正版。若所列资源侵犯了您的权益，请直接留言，立刻删除!</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></span></strong></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">猪场成本核算的意义</span></strong><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">①通过产品成本核算，明确了产品成本构成的项目，加强了财务管理。从上述产品核算的过程及结果中我们可以明确地看到产品成本构成的项目。如果有不合理的开支项目，在核算的过程中必然会暴露出来。此类项目的多少与大小直接影响着企业的生产成本，也反映了企业财务管理的状态。进行细致而严格的企业产品成本核算，必然会加强企业的财务管理，减少财务漏洞，从而降低产品生产成本，提高企业经济效益。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">②通过产品成本核算，明确了产品的总成本及单位成本。产品核算的结果告诉我们，每生产一单位的产品需用多少资金，那么我们就可以根据产品市场售价随时了解企业的盈亏状态。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">③通过产品成本核算，了解了产品总成本中各项成本的比例。了解这个比例有利于决策者对现实的成本构成做出正确的评价，发现问题的同时找到机遇。提高固定资产利用率，降低固定成本的比例始终是追求企业经济效益的有效方法之一。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">④进行全面的成本核算有利于对企业实行全面的计划管理。当我们通过成本核算得到某一企业在其具体环境中单位产品的赢利额时，我们就可以根据该企业的平均固定成本数额确定盈亏点。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">⑤提高生产效率，可以降低固定成本及变动成本。通过进行成本核算我们看到，产品的成本构成是由固定成本和变动成本两大部分组成，提高生产效率可以同时降低此两项的总额。所以提高技术水平，调动职工积极性，提高企业合格产品的数量，减少单位产品的摊销费用从而降低成本，可以达到提高企业效益的目的。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">综上所述，加强企业成本核算，并对核算的结果进行细致的分析是提高猪场经济效益最重要的途径之一。很难想像一个没有进行严格的成本核算的企业、一个不能对成本结构进行经济分析的企业，能够采取有效的措施使企业产生良好的经济效益。因此，对猪场进行成本核算和成本管理，学会对核算的结果进行科学分析，并适时做出正确决策是未来猪场进一步提高市场竞争能力的重要措施。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">以上简单的阐述了成本的核算的意义。下面是一些看不见的因素影响成本。</span></strong></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">一、饲料因素</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">1</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、饲料配方不随季节变化的浪费</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">一年四季，气温不同，猪对营养的需要也不同，但现在不论饲料厂推荐的配方，还是请专家设计的配方，都不可能在一年四季都适用。冬季用高蛋白配方，会造成蛋白的浪费，夏天用高能配方会造成能量的浪费等。如果我们能适时调整配方，使全群料肉比从3.5降到3.4的话，对一个万头猪场来说，一年就可节省饲料10000×90×0.1=90000公斤，折合人民币12万元以上。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">2</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、使用高水分玉米而不改变配方的浪费</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">在秋冬季，常听到养猪户反映预混料或浓缩料质量不好了，猪光吃不长。根据了解，造成猪生长缓慢的原因并不是由预混料或浓缩料质量引起的，而是由于当时玉米水分过大造成的。因秋冬季，气温偏低，猪对能量的需要量要大于春夏季节，而这时的玉米多是新收获的玉米，水分多在20%以上，所配合出的饲料就存在能量不足现象，如不修改配方，且按固定饲喂程序进行的话，必定会出现能量不足，影响猪的正常生长。解决这一问题的办法很简单，一是在其它原料不变的情况下，加大玉米比例，同时加大饲喂量;二是在用湿玉米的同时，配合高能量饲料如油脂等，这适合于需要能量浓度大的乳猪料或仔猪料中。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">3</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、不按配方加工饲料的浪费</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">有几种情况，一是加工料时不过称;二是缺乏一种原料时，轻易用其它原料代替;三是原料以次充好，如用湿玉米代替干玉米等。以上三种情况都会破坏饲料配方的合理性，影响饲料利用率。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">4</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、搅拌不均匀的浪费</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">搅拌不均匀在许多猪场出现过，手工拌料自不必说，就是机器拌料也常出现搅拌不均匀的情况。边粉碎边出料的有，搅拌时间不足的有。最容易忽视的是在饲料中加入药物或微量添加剂，不通过预混直接倒进搅拌机，在上千斤饲料中加入几十克药品，很难做到搅拌均匀。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">5</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、大猪吃小猪料的浪费</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">经常遇到小猪吃乳猪料，中猪吃小猪料，大猪吃中猪料现象，这些都会造成饲料的浪费。而更严重的是让后备猪吃育肥猪料，大大推迟母猪发情时间，影响正常配种。这些看似不重要，但如果仔细算一笔账，你会大吃一惊的。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">二、药品浪费</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">1</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、以次充好的浪费</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">现在药品市场很混乱，同一产品因生产厂家不同，价位相差很多，有的甚至上倍。有的同一药店中土霉素原粉价格在四十元到八十元不等，使用不同价位的药品效果是不同的。这里说浪费是说用劣质药品会浪费治疗时间和我们对某一药品的信心。如果这样，我们会因为使用一次劣质药品而放弃一种很好的药物。如果老板进药时，片面追求低价，时间长了，会让兽医无药可用。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">2</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、使用方法不当的浪费</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">这种情况出现在以下几种情况：(1)给已经拒绝采食的猪料中加药。 (2)不溶于水的药物用饮水给药。(3)对已发病猪群用预防剂量。以上三种情况对治疗是没效果或效果很差的，药品浪费在所难免。所以在大群用药时应考虑到猪群的状况，对症用药。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">3</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、无病乱用药的浪费</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">猪病之多，危害之大，让养猪人士谈病色变。一些人主张长期大剂量用药物控制，有不少场取得了不错的效果，这种方法已为人们接受。但我对这一办法有不同的看法，不仅是因为大量用药增加成本，更主要的是长期大剂量用药后，一旦停药就可能引起疾病暴发。这也就出现了哺乳仔猪好养而保育猪难养，保育猪养好了却在生长育肥上出问题的反常现象。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">4</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、用弱毒菌苗同时用抗生素的浪费</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">疫苗预防和药物预防都是控制细菌性传染病的有效措施，但二者同时使用却没有好效果。因弱毒菌苗仍是活的细菌，如同时使用抗生素，这些菌苗会被抗生素杀死，起不到激发猪体产生免疫力的目的，不但会造成疫苗的浪费，还会误导我们的思路，因已防疫过的猪仍发生该种疾病。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">三、肥猪出栏时间过长的浪费</span></strong></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">1</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、成本核算的基本概念。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">成本核算是企业进行产品成本管理的重要内容，是猪场不断提高经济效益和市场竞争能力的重要途径。猪场的成本核算就是对猪场生产仔猪、商品猪、种猪等产品所消耗的物化劳动和活劳动的价值总和进行计算，得到每个生产单位产品所消耗的资金总额，即产品成本。成本管理则是在进行成本核算的基础上，考察构成成本的各项消耗数量及其增减变化的原因，寻找降低成本的途径。在增加生产量的同时，不断地降低生产成本是猪场扩大赢利的主要方法。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">为了客观反映生产成本，我们必须注意成本与费用的联系和区别。在某一计算期内所消耗的物质资料和活劳动的价值总和是生产费用，生产费用中只有分摊到产品中去的那部分才构成生产成本，两者可以是相等的也可以是不等的。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">2</span><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">、生产成本核算的方法。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">进行生产成本的核算需要完整系统的生产统计数据，这些数据来自于日常生产过程中的各种原始记录及其分类整理的结果，所以建立完整的原始记录制度、准确及时的记录和整理是进行产品成本核算的基础。通过产品的成本核算达到降低生产成本、提高经济效益的目的，我们需要了解具体的成本核算方法。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">第一步，确定成本核算对象、指标和计算期单位。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">养猪场生产的终端产品是仔猪、种猪和商品猪，成本核算的指标是每千克或每头产品的成本资金总量，计算期有月、季度、半年、年等单位。现以100头基础母猪、本年度存栏变化很小(如变化较大应将增减的猪群消耗剔除，消除其影响)的小型猪场为例，将商品猪作为成本核算的对象，以元/千克、元/头为核算成本的指标，以年为计算期单位说明猪场成本核算的具体过程和方法。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">第二步，确定构成养猪场产品成本的项目。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">一般情况下将构成猪场产品成本核算的费用项目分为两大类，即固定费用项目和变动费用项目。变动费用项目是指那些随着猪场生产量的变化其费用大小也显著变化的费用项目，例如猪场的饲料费用;固定费用项目是指那些与猪场生产量的大小无关或关系很小的费用项目，其特点是一定规模的养猪场随着生产量的提高由固定费用形成的成本显著降低，从而降低生产总成本，这就是规模效应，降低固定费用是猪场提高经济效益的重要途径之一。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">①变动成本费用项目：饲料、药品、煤、汽油、电和低值易耗物品费。其中饲料包含饲料的买价、运杂费和饲料加工费等。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">②固定成本费用项目：饲养人员工资、奖金、福利费用，以及猪场直接管理人员费用、固定资产折旧和维修费。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">第三步，成本核算过程。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">各类成本发生额如下：</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">变动成本中原材料采购成本的核算：</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">采购费用分配率=采购费用总额/原料总买价×100%原料采购成本：买价与采购费用分配率的乘积。</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;text-indent: 28px;box-sizing: border-box !important;word-wrap: break-word !important;background-image: initial;background-attachment: initial;background-size: initial;background-origin: initial;background-clip: initial;background-position: initial;background-repeat: initial;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\">饲料产品加工费分配量=加工费总额/加工总量已消耗饲料产品的成本价：原料组成价÷损耗率+加工费分配量。（资料来源：智慧猪场）</span></p><p style=\"margin-top: 0px;margin-bottom: 0.1px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;line-height: 25.6px;text-align: center;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;font-size: 14px;\"></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;line-height: 25.6px;text-align: center;box-sizing: border-box !important;word-wrap: break-word !important;\"><br/></p><p><br/></p>','','0','0','1453862496'),
('18','50','0','2016年生猪出栏量会大幅度降低，猪价或在17-18元/公斤','','生猪存栏量季节性下降,但仍创新低:4季度尤其是11-12月份逢春节消费旺季,是生猪出栏的高峰期,导致生猪存栏量的季节性下降。','images/3/2016/01/mXuucMypybpBzWPmyCMFC0xMmh25m0.jpg','<script></script><h2 id=\"activity-name\" class=\"rich_media_title\">2016年生猪出栏量会大幅度降低，猪价或在17-18元/公斤</h2><p><br/></p><p><span id=\"js_profile_arrow_wrp\" class=\"profile_arrow_wrp\"><em class=\"profile_arrow arrow_out\"></em><em class=\"profile_arrow arrow_in\"></em></span></p><script></script><p><img id=\"js_cover\" class=\"rich_media_thumb\" src=\"http://mmbiz.qpic.cn/mmbiz/8e1hx3LZSiabQ4FEJRiaBYOMicxDNZ2oC4ib8ibNpeW3OOAUPvm59alVpHTKB3o6gicXEOdcQDCcuXI2C6tgvMbIWJjA/640?wx_fmt=jpeg&wxfrom=5\" data-backsrc=\"http://mmbiz.qpic.cn/mmbiz/8e1hx3LZSiabQ4FEJRiaBYOMicxDNZ2oC4ib8ibNpeW3OOAUPvm59alVpHTKB3o6gicXEOdcQDCcuXI2C6tgvMbIWJjA/0?wx_fmt=jpeg\"/></p><p style=\"background: white;text-indent: 28px;margin-bottom: 0.1px;\"><span style=\"color: rgb(34, 34, 34);font-size: 14px;\"></span></p><p style=\"line-height: 25.6px;white-space: normal;background-color: white;\"><br/></p><p style=\"line-height: 25.6px;white-space: normal;background-color: white;\"><span style=\"font-family: 宋体;font-size: 12px;\">免责申明：本微信服务平台资料来源于网络收集，以供给大家学习、交流为目的，请诸位在阅读后，尽快删除，尊重资料原作者，支持正版。若所列资源侵犯了您的权益，请直接留言，立刻删除!</span></p><p style=\"background: white;text-indent: 28px;margin-bottom: 0.1px;\"><span style=\"color: rgb(34, 34, 34);font-size: 14px;\"><br/></span></p><p style=\"background: white;text-indent: 28px;margin-bottom: 0.1px;\"><span style=\"color: rgb(34, 34, 34);font-size: 14px;\">生猪存栏量季节性下降,但仍创新低:4季度尤其是11-12月份逢春节消费旺季,是生猪出栏的高峰期,导致生猪存栏量的季节性下降。生猪存栏量在经历7月至10月短暂的小幅上升(+1.61%)后,12月份生猪存栏量回落至3.84亿头,创有统计数据以来的新低。从2015年全年来看,除1月以外,其余每个月生猪存栏量下降幅度均在10%左右,全年生猪存栏量的平均值3.89亿头,同比下降9.95%。</span><br/></p><p style=\"text-indent: 28px;word-wrap: break-word !important;min-height: 1em;max-width: 100%;box-sizing: border-box !important;background-color: white;\"><span style=\"color: rgb(34, 34, 34);font-size: 14px;\">能繁母猪环比下跌:12月份能繁母猪存栏量环比下滑0.7%至3,798万头,比11月份下降约27万头,为自2013年8月以来连续28个月下降。全年能繁母猪存栏量平均约为3,933万头,同比下降14.31%。淘汰母猪的量依旧维持在高位,而初配母猪的量没能跟上,这两个指标综合后可以看出来能繁母猪依然在持续下滑。</span></p><p style=\"text-indent: 28px;word-wrap: break-word !important;min-height: 1em;max-width: 100%;box-sizing: border-box !important;background-color: white;\"><span style=\"color: rgb(34, 34, 34);font-size: 14px;\">16</span><span style=\"color: rgb(34, 34, 34);font-size: 14px;\">年生猪出栏量预计下降超-10%,达最大出栏降幅:2015年能繁母猪的低基数将决定2016年生猪出栏量会大幅度降低,以2014年、2015年平均的能繁母猪存栏量4,590万头、3,933万头,平均PSY 14.7头、15.2头来测算,</span><span style=\"word-wrap: break-word !important;max-width: 100%;box-sizing: border-box !important;\"><span style=\"color: rgb(0, 122, 170);font-size: 14px;\">我们预计2015年至2016年生猪出栏量分别为6.98亿头和6.17亿头</span></span><span style=\"color: rgb(34, 34, 34);font-size: 14px;\">,</span><span style=\"color: rgb(34, 34, 34);font-size: 14px;\">降幅分别为-5%和-12%。2015年的出栏量预计会创下2008年以来最大的降幅,而2016年下降幅度将会更甚。以77%的出肉率来测算,2015年和2016年的猪肉产量预计分别为5,391万吨和4,773万吨,分别下降4.93%和11.47%。生猪市场供给的压力在2016年会更加凸显出来。</span></p><p style=\"text-indent: 28px;word-wrap: break-word !important;min-height: 1em;max-width: 100%;box-sizing: border-box !important;background-color: white;\"><span style=\"color: rgb(34, 34, 34);font-size: 14px;\">猪价上行趋势在2季度会表现的更清晰,成本下降是趋势:12月下旬以来,猪价开始止跌,元旦过后,猪价在短期内从16.75元上涨到18元,上涨超过7%。这一轮猪价上涨有助于稳定市场的预期,尽管春节过后猪价大概率会面临回调,但已很难调整到17元下方。</span><span style=\"word-wrap: break-word !important;max-width: 100%;box-sizing: border-box !important;\"><span style=\"color: rgb(0, 122, 170);font-size: 14px;\">基于对16年出栏量的大幅下降、而需求相对保持稳定的判断,全年猪价均值预计在17-18元/公斤范围。</span></span><span style=\"color: rgb(34, 34, 34);font-size: 14px;\">从成本端来看,大宗饲用农产品供应充足、美元升值以及政策放开,对其价格构成压力。但会降低养殖行业的成本,侧面提升养殖公司的盈利。</span></p><p style=\"text-indent: 28px;word-wrap: break-word !important;min-height: 1em;max-width: 100%;box-sizing: border-box !important;background-color: white;\"><span style=\"color: rgb(34, 34, 34);font-size: 14px;\">继续配置养殖股。以3月初猪价从11.8元到8月初的18.7元,期间猪价最高涨幅达到58%,而后经历长达3个多月的调整,是为第一波上涨。剔除掉春节因素,节后的猪价也会维持在比较高的位置。越往后,供给相对短缺还会继续体现出来。另外,15年以来商业库存亦处在很低的位置,以往的这一负面影响被抵消掉。第二波猪价的上涨或会在1、2季度交接的时候到来。（资料来源：中银国际证券）</span></p><p style=\"text-align: center;line-height: 25.6px;margin-bottom: 0.1px;white-space: normal;\"><br/></p>','','0','0','1453866457'),
