 给我多放点肉，放，再放，再放点，再多放点……”,老板抬头看着他：“我给你卷头猪吧？”</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><strong style=\"color: rgb(192, 0, 0);margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.7;\"><img src=\"http://market.hasxmy.com/we4/attachment/images/3/2016/01/h6I299anfiRUUR3R933ffaE0sr2eDp.jpg\" width=\"100%\" alt=\"images/3/2016/01/h6I299anfiRUUR3R933ffaE0sr2eDp.jpg\"/>故事二：</span></strong><br/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;color: rgb(192, 0, 0);\"><strong style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.7;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></span></strong></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.7;\">曾经有一个业务员问老板：“市场上有一个小厂，价格很低，很难对付，怎么办？”</span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.7;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><span style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;line-height: 1.7;\"></span>老板反问道：“既然这家厂这么厉害，为什么一直是家小厂，而我们却是大厂呢？”</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><br style=\"margin: 0px;padding: 0px;max-width: 100%;box-sizing: border-box !important;word-wrap: break-word !important;\"/></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\">实际上，低价在市场上通常只是扮演着“搅局”的角色，成事不足，败事有余。在对抗性竞争中，高价经常被低价搅得心烦意乱甚至胆战心惊，但低价最终总是难敌高价，甚至在高价面前一败涂地。</p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;max-width: 100%;clear: both;min-height: 1em;white-space: pre-wrap;box-sizing: border-box !important;word-wrap: break-word !important;\"><img src=\"http://market.hasxmy.com/we4/attachment/images/3/2016/01/SPv157NOvRnp51zNM7o659N11n1ZbV.jpg\" width=\"100%\" alt=\"