('16','45','0','庆平台顺利开通，人工乳“好妈妈”限时抢购中','zhp','庆平台顺利开通，人工乳“好妈妈”限时抢购中','images/3/2016/01/mUwM1nRMzQMNAmZ9A7NnyNnkaBY9Q7.jpg','<p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;为了庆祝<span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">饲料微商</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">线上交易平台顺利开通，感谢广大客户对</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">三星牧业</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">的关爱和支持，自</span><span style=\"font-family:Calibri\">2016</span><span style=\"font-family:宋体\">年</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">16</span><span style=\"font-family:宋体\">日至</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">22</span><span style=\"font-family:宋体\">日，本平台持续开展线上限时抢购活动，具体规则如下：</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;<span style=\"font-family:宋体\">一、活动内容：</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、活动期间原价</span><span style=\"font-family:Calibri\">50</span><span style=\"font-family:宋体\">元</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">袋的仔猪人工乳</span><span style=\"font-family: Calibri;font-size: 16px;color: rgb(255, 0, 0);\"><span style=\"font-family: Calibri;\">“</span><span style=\"font-family: 宋体;\">好妈妈</span><span style=\"font-family: Calibri;\">”</span></span><span style=\"font-family:宋体\">每天</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">：</span><span style=\"font-family:Calibri\">00-11</span><span style=\"font-family:宋体\">：</span><span style=\"font-family:Calibri\">00</span><span style=\"font-family:宋体\">抢购仅需</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">元</span><span style=\"font-family:Calibri\">/</span><span style=\"font-family:宋体\">袋。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、每个会员抢购时间段内最多抢购</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">袋。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;<span style=\"font-family:宋体\">二、抢购方法：</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、公众平台输入</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">抢购</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">，点击</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">查看全文</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\"></span>详细查看本次活动内容<span style=\"font-family:宋体\">。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、进入平台后，点击</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">饲料商城</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">选择</span><span style=\"font-family:Calibri\">“</span><span style=\"font-family:宋体\">抢购商品</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">，规定时间段内进入跳转页面直接选择</span><span style=\"font-family:Calibri\">“直接</span><span style=\"font-family:宋体\">购买</span><span style=\"font-family:Calibri\">”</span><span style=\"font-family:宋体\">按提示操作即可。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;<span style=\"font-family:宋体\">三：声明</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;1<span style=\"font-family:宋体\">、本品为促销产品，本品</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">袋以上或配合公司其他平台产品均包邮，运费公司承担，订购本产品</span><span style=\"font-family:Calibri\">10</span><span style=\"font-family:宋体\">袋以下，运费需自行承担</span></span><span style=\";font-family:&#39;Times New Roman&#39;;font-weight:bold\">（省内运费约<span style=\"font-family:Times New Roman\">5</span><span style=\"font-family:宋体\">元，省外运费约</span><span style=\"font-family:Times New Roman\">20</span><span style=\"font-family:宋体\">元，以实际发生金额为准）。</span></span></p><p><span style=\";font-family:Calibri;font-size:16px\">&nbsp;&nbsp;&nbsp;2<span style=\"font-family:宋体\">、订购后公司采用物流方式投送，河南省内仅投送至县级以上物流点，省外仅投送至市级以上物流点。</span></span></p><p><br/></p>','http://market.hasxmy.com/we4/app/index.php?i=3&c=entry&p=detail&id=32&do=shop&m=ewei_shop','11','1','1453991495'),
('17','48','0','平台升级通知','张会朋','元月23日-元月28日平台持续升级（详见店铺公告）','images/3/2016/01/CyO0why1j607ZhFpZPObjbw1PbpO72.jpg','<p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">各位亲们：</span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">首先感谢大家对“饲料微商”的关注和支持，为了能更好地为大家提供服务，经研究决定自<span style=\"font-family:Calibri\">2016</span><span style=\"font-family:宋体\">年元月</span><span style=\"font-family:Calibri\">23</span><span style=\"font-family:宋体\">日</span><span style=\"font-family:Calibri\">-</span><span style=\"font-family:宋体\">元月</span><span style=\"font-family:Calibri\">31</span><span style=\"font-family:宋体\">日开展平台持续升级工作，主要升级内容主要有：</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;1<span style=\"font-family:宋体\">、菜单的变更和调整</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;2<span style=\"font-family:宋体\">、店面装修和美化</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;3<span style=\"font-family:宋体\">、个别功能性模块调整。</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;4<span style=\"font-family:宋体\">、会员分组管理。</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">因系统升级给您带来的不便我们深表歉意，升级期间我们将会采用边运营边升级的的方法，并向大家承诺，升级不会影响您的：</span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;1<span style=\"font-family:宋体\">、会员等级和佣金分成。</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;2<span style=\"font-family:宋体\">、商品订购和发货。</span></span></p><p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;3<span style=\"font-family:宋体\">、余额和微信支付的安全。</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">再次感谢大家的支持和配合，在使用过程中如您遇到不明白之处，请致电：<span style=\"font-family:Calibri\">4009939099</span><span style=\"font-family:宋体\">转业务咨询，或联系在线客服</span><span style=\"font-family:Calibri\">QQ</span><span style=\"font-family:宋体\">：</span><span style=\"font-family:Calibri\">390071985</span><span style=\"font-family:宋体\">，升级期间将会为您提供全天</span><span style=\"font-family:Calibri\">24</span><span style=\"font-family:宋体\">小时服务。</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: 宋体;font-size: 14px\">&nbsp;</span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;饲料微商电子商务管理中心</span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2016<span style=\"font-family:宋体\">年</span><span style=\"font-family:Calibri\">1</span><span style=\"font-family:宋体\">月</span><span style=\"font-family:Calibri\">23</span><span style=\"font-family:宋体\">日&nbsp;</span></span></p><p style=\"text-indent:28px;text-align:justify;text-justify:inter-ideograph\"><span style=\";font-family:宋体;font-weight:bold;font-size:14px\">&nbsp;</span></p><p><br/></p>','','20','1','1453991521'),
('19','51','0','河南三星牧业科技有限公司欢迎您','运营部','河南三星牧业科技有限公司欢迎您','images/3/2016/01/JLLbJK2ukjj3KkklwKsj2E3KLEu2SL.jpg','<p><img src=\"http://market.hasxmy.com/we4/attachment/images/3/2016/01/sM1lJ162Kz21414Hlz1J1ZdZd6L46k.gif\" width=\"100%\" alt=\"images/3/2016/01/sM1lJ162Kz21414Hlz1J1ZdZd6L46k.gif\"/></p>','','100','1','1453992201'),
('20','53','0','饲料微商平台新闻发布会','新闻部','”饲料微商”线上交易平台顺新闻发布会顺利召开','images/3/2016/01/gLqbOP8PPkGf8mQ7u55MPB7BPM9uGp.jpg','<p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;clear: both;font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25.6px;white-space: normal;text-indent: 28px;text-align: justify;\"><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">2016<span style=\"margin: 0px;padding: 0px;\">年</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">1</span></span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;font-size: 14px;\">月</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">26</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;font-size: 14px;\">日，</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">由河南三星牧业科技有限公司主办，在中国饲料信息网、河南畜牧信息网、河南日报农村版、河南畜牧兽医杂志社、河南电视台新农村频道、河南电台农村广播等</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">10<span style=\"margin: 0px;padding: 0px;\">余家新闻媒体单位的共同支持下，河南三星牧业电子商务平台新闻发布会</span></span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">在郑州黄河迎宾馆</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">顺利召开。</span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;clear: both;font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25.6px;white-space: normal;text-indent: 28px;text-align: justify;\"><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">发布会首先由</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;font-size: 14px;\">公司</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">总经理王丰收向各位与会嘉宾通报了公司开展电子商务平台“饲料微商”工作的背景和目的。王总说：</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">我国饲料工业经过近四十年的发展，已初步形成饲料加工业、饲料原料工业、饲料添加剂工业、饲料机械工业、饲料科研教育等为支撑的饲料工业体系，在推动现代养殖业发展方面起到重要作用。在电子商务背景下，饲料工业的发展面临新的挑战和机遇，李克强</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">总理</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">在政府工作报告中提出，“制定‘互联网+’行动计划，推动移动互联网、云计算、大数据、物联网等与现代制造业结合，促进电子商务、工业互联网和互联网金融健康发展，引导互联网企业拓展国际市场。”</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">为此，河南三星牧业科技有限公司及时抓住发展</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">机遇，</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">在不断发展的前提下，</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">&nbsp;在互联网高速发展的时代，借助网络手段，实现传统的饲料行业顺应发展之势，搭乘网络快车，打造诚信、实用、便捷的电子商务平台。来更好地服务广大养殖户，</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">在新时期下</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">引领</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">饲料行业进入互联网</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">+时代，从而更好地</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;\">推动我国饲料工业的可持续发展。</span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;clear: both;font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25.6px;white-space: normal;text-indent: 28px;text-align: justify;\"><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">接着王丰收总经理又从平台运营原则、运营情况、发展目标等几个方面向各位嘉宾简单介绍了“饲料微商”电子商务平台的情况。</span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;clear: both;font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25.6px;white-space: normal;text-indent: 28px;text-align: justify;\"><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">一、</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">平台的运营的基本原则</span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;clear: both;font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25.6px;white-space: normal;text-align: justify;\"><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">&nbsp;&nbsp;在公司“&nbsp;饲料微商”电子商务平台建设和运行过程中，我们秉承产品质量、公司诚信第一，简化饲料供应流程，拒绝传统销售中间环节，切实还利养殖户，服务养殖户基本发展原则。并在公司<span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">2015</span><span style=\"margin: 0px;padding: 0px;\">年</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">3</span><span style=\"margin: 0px;padding: 0px;\">月</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">15</span><span style=\"margin: 0px;padding: 0px;\">日的启动会议上，参于项目建设的各部门会议上一直通过了：“饲料微商”电子商务平台，始终坚持“</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">B2C</span><span style=\"margin: 0px;padding: 0px;\">”（厂家直接到用户）运营模式，拒绝中间商，还利养殖户”的重要决议。平台运行伊始，平台先后通过“微信官方”、“支付宝官方”等公共支付系统的认证，彻底解决货款安全问题，目前正在和国家四大银行协调开通银联支付系统，拓宽用户的安全支付渠道。平台运行过程中，我们坚持“线上”购买全国统一成本价格销售，并向用户承诺，因产品质量问题，公司无条件退款。同时我们开通技术、售后服务措施，通过电话、</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">qq</span><span style=\"margin: 0px;padding: 0px;\">、微信等方式及时解决用户购买过程中出现的各种障碍。为了使平台得到更好的推广，让更多养殖户朋友体验互联网时代的优势，公司在成本内再投入设置推广基金，定期推出的各种让利活动，持续对推广者的提供推广佣金提成，让所有用户在消费中享受更多的实惠，在推广中获取更大的快乐。</span></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;clear: both;font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25.6px;white-space: normal;text-indent: 28px;text-align: justify;\"><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">二、平台运营现状</span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;clear: both;font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25.6px;white-space: normal;text-indent: 28px;text-align: justify;\"><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">经过持续筹备和建设，公司“饲料微商”电子商务平台于2016年<span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">1</span><span style=\"margin: 0px;padding: 0px;\">月</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">11</span><span style=\"margin: 0px;padding: 0px;\">日上线试运行以来，在短短半个月时间内，关注量急剧攀升，止于今天，点击量</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">6806</span><span style=\"margin: 0px;padding: 0px;\">，关注量已达到</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">836</span><span style=\"margin: 0px;padding: 0px;\">个微信号，粉丝数量</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">1986</span><span style=\"margin: 0px;padding: 0px;\">位，订单数量</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">1658</span><span style=\"margin: 0px;padding: 0px;\">个，实际交易数量</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">682</span><span style=\"margin: 0px;padding: 0px;\">笔。发展速度远远超过预期。业务过程累计销售教槽产品</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">312</span><span style=\"margin: 0px;padding: 0px;\">吨、其他产品</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">518</span><span style=\"margin: 0px;padding: 0px;\">吨，促销商品</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">988</span><span style=\"margin: 0px;padding: 0px;\">件。受理平台操作咨询和服务</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">65</span><span style=\"margin: 0px;padding: 0px;\">件，成功处理</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">65</span><span style=\"margin: 0px;padding: 0px;\">件，售后服务咨询和问题</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">32</span><span style=\"margin: 0px;padding: 0px;\">件，成功处理</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">32</span><span style=\"margin: 0px;padding: 0px;\">件。接受操作失误退款申请</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">2</span><span style=\"margin: 0px;padding: 0px;\">起，退还金额</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">6000</span><span style=\"margin: 0px;padding: 0px;\">元，电话回访客户满意度调查，满意率</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">98%</span><span style=\"margin: 0px;padding: 0px;\">。</span></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;clear: both;font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25.6px;white-space: normal;text-indent: 28px;text-align: justify;\"><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">三、</span><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">平台发展目标展望</span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;clear: both;font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25.6px;white-space: normal;text-indent: 28px;text-align: justify;\"><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">在运行过程中，我们真正体会到了在互联网时代，公司“饲料微商”电子商务平台为广大养殖户带来的便利和实惠，为企业先进技术和产品推广提供了实用便捷的方式，再次坚定我们打造中国第一饲料电子商务平台的信念。我们将在现有的基础上，在平台建设方面继续优化服务模块，拓宽服务功能，继续保证平台运营的安全性。公司也会继续加大对电子商务平台的投入，本年度继续开展“零利润，成本内再投入”的运营模式，坚持“拒绝中间商、还利养殖户”的发展原则。并在今后逐渐完善：平台的“专属物流运输系统、养殖技术远程服务体系、实体店体验和售后服务网点等和平台相关的各项工作。我们预计，在公司的不断努力下，在社会各界的不断支持和关注下，公司“饲料微商”电子商务平台借乘互联网时代东风，<span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">2016</span><span style=\"margin: 0px;padding: 0px;\">年度一定能实现关注量过万，粉丝量过十万的发展速度，线上销售商品高达</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">6</span><span style=\"margin: 0px;padding: 0px;\">万吨，交易金额</span><span style=\"margin: 0px;padding: 0px;font-family: Calibri;\">3</span><span style=\"margin: 0px;padding: 0px;\">亿元。我们相信，在公司全体员工的共同努力下，在互联网高速发展时代“河南三星牧业科技有限公司”必将成为行业电子商务方面的一匹黑马，“饲料微商”电子电子商务平台也必将成为中国第一电子商务平台。</span></span></p><p style=\"margin-top: 0px;margin-bottom: 0px;padding: 0px;clear: both;font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif;line-height: 25.6px;white-space: normal;text-indent: 28px;text-align: justify;\"><span style=\"margin: 0px;padding: 0px;font-family: 宋体;font-size: 14px;\">王总最后郑重地说：“我是王丰收，我为饲料微商代言”，再次感谢大家对公司“饲料微商”电子商务平台的关注和支持，并诚挚邀请您为“饲料微商”代言，发布会在一片激情的掌声中顺利闭幕。</span></p><p></p><p>文章来源：三星牧业大数据营销中心新闻部<br/></p>','','20','1','1454034910'),
('21','54','0','“饲料微商”电子商务平台操作指南','运营部','“饲料微商”电子商务平台操作指南','images/3/2016/01/NnUnqt7DDnPdWlnsbz9AupTPwZWHhj.jpg','<p><span style=\";font-family:宋体;font-size:14px\">亲：</span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;&nbsp;感谢您关注“饲料微商”电子商务平台，为了方便您的使用，现把本平台的详细操作方法介绍如下：</span></p><p style=\"text-align: center;\"><strong><span style=\";font-family:宋体;font-size:14px\">第一部分：平台运行要求和关注方法</span></strong></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;&nbsp;</span><strong><span style=\";font-family:宋体;font-size:14px\">一、</span><span style=\";font-family:宋体;font-size:14px\">运行要求</span></strong></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;&nbsp;本平台基于腾讯微信基础开发，凡是支持运行“微信”程序的手机和其他电子设备均可运行本平台（本指南以安卓系统手机为例）。</span></p><p><span style=\";font-family:宋体;font-size:14px\">&nbsp;&nbsp;</span><strong><span style=\";font-family:宋体;font-size:14px\">二、</span><span style=\";font-family:宋体;font-size:14px\">关注方法</span></strong></p><p><span style=\"font-family: 宋体;font-size: 14px;text-indent: 28px;\">&nbsp;</span><strong><span style=\"font-family: 宋体;font-size: 14px;text-indent: 28px;\">&nbsp;1</span><span style=\"font-family: 宋体;font-size: 14px;text-indent: 28px;\">、微信搜索</span></strong></p><p><span style=\"font-family: 宋体;font-size: 14px;text-indent: 28px;\"> &nbsp;&nbsp;第一步：打开手机微信，点击搜索</span></p><p style=\"text-indent: 28px;text-align: center;\"><span style=\";font-family:宋体;font-size:14px\"><span style=\"font-family:宋体\"><img src=\"http://market.hasxmy.com/we4/attachment/images/3/2016/01/m2ma8Eu1Z2QfvJj8hjJHu822l1e2E2.jpg\" width=\"343\" alt=\"微信搜索_副本.jpg\" height=\"437\" style=\"width: 343px;height: 437px;\"/></span></span></p><p>&nbsp;&nbsp;第二步：输入“饲料微商”或“sxmy4009939099”，点击“搜一搜”</p><p style=\"text-align: center;\">&nbsp;<img src=\"http://market.hasxmy.com/we4/attachment/images/3/2016/01/yB4RbqbZ54dPJqp11rE55NpbDOaqX5.jpg\" width=\"340\" alt=\"输入饲料微商.jpg\" height=\"484\" style=\"width: 340px;height: 484px;\"/></p><p>&nbsp;&nbsp;第三部：进入提示页面点击“关注”，然后确认</p><p style=\"text-align: center;\">&nbsp;<img src=\"http://market.hasxmy.com/we4/attachment/images/3/2016/01/BNnh1cknn3Q6M1cMi7KK6QuK7mqnim.jpg\" width=\"338\" alt=\"images/3/2016/01/BNnh1cknn3Q6M1cMi7KK6QuK7mqnim.jpg\" height=\"477\" style=\"width: 338px;height: 477px;\"/></p><p>&nbsp;&nbsp;第四部：进入平台欢迎页面</p><p style=\"text-align: center;\"><img src=\"http://market.hasxmy.com/we4/attachment/images/3/2016/01/Fz29re6xK98z2VO94e9892yoerny0y.jpg\" width=\"338\" alt=\"进入欢迎页面.jpg\" height=\"486\" style=\"width: 338px;height: 486px;\"/></p><p>&nbsp;</p><p><strong>&nbsp;&nbsp;</strong></p><p style=\"text-align: center;\">&nbsp;</p><p><span class=\"edui-editor-imagescale-hand0\" style=\"box-sizing: border-box;position: absolute;width: 6px;height: 6px;overflow: hidden;font-size: 0px;display: block;cursor: nw-resize;top: 0px;margin-top: -4px;left: 0px;margin-left: -4px;color: rgb(51, 51, 51);font-family: arial, &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, 微软雅黑, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti;background-color: rgb(60, 157, 208);\"></span><span class=\"edui-editor-imagescale-hand1\" style=\"box-sizing: border-box;position: absolute;width: 6px;height: 6px;overflow: hidden;font-size: 0px;display: block;cursor: n-resize;top: 0px;margin-top: -4px;left: 169px;margin-left: -4px;color: rgb(51, 51, 51);font-family: arial, &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, 微软雅黑, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti;background-color: rgb(60, 157, 208);\"></span><span class=\"edui-editor-imagescale-hand2\" style=\"box-sizing: border-box;position: absolute;width: 6px;height: 6px;overflow: hidden;font-size: 0px;display: block;cursor: ne-resize;top: 0px;margin-top: -4px;left: 338px;margin-left: -3px;color: rgb(51, 51, 51);font-family: arial, &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, 微软雅黑, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti;background-color: rgb(60, 157, 208);\"></span><span class=\"edui-editor-imagescale-hand3\" style=\"box-sizing: border-box;position: absolute;width: 6px;height: 6px;overflow: hidden;font-size: 0px;display: block;cursor: w-resize;top: 234.5px;margin-top: -4px;left: 0px;margin-left: -4px;color: rgb(51, 51, 51);font-family: arial, &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, 微软雅黑, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti;background-color: rgb(60, 157, 208);\"></span><span class=\"edui-editor-imagescale-hand4\" style=\"box-sizing: border-box;position: absolute;width: 6px;height: 6px;overflow: hidden;font-size: 0px;display: block;cursor: e-resize;top: 234.5px;margin-top: -4px;left: 338px;margin-left: -3px;color: rgb(51, 51, 51);font-family: arial, &#39;Hiragino Sans GB&#39;, &#39;Microsoft Yahei&#39;, 微软雅黑, 宋体, 宋体, Tahoma, Arial, Helvetica, STHeiti;background-color: rgb(60, 157, 208);\"><br/><br/></span></p>','','100','1','1454140046');
